import React, { Component } from 'react';
import './beranda.css';
import Banner from './img/banner.png';
import TrendingTicket from './img/trending-ticket.png'; // Import gambar tiket yang sedang tren

class Beranda extends Component {
    render() {
        return (
            <div className="container">
                {/* 1. Banner Image */}
                <img
                    src={Banner}
                    className="banner-img"
                />
                {/* 2. Trending Ticket */}
                <img
                    src={TrendingTicket} // Menggunakan gambar tiket yang sedang tren
                    alt="Trending Ticket"
                    className="trending-ticket"
                />
            </div>
        );
    }
}

export default Beranda;
